package cn.com.evo.integration.wasu.common.content;import java.util.List;/** * @Description: * @author: lu.xin * @create: 2019-04-25 12:48 PM **/public class WasuColumnData {    private List<WasuColumn> folders;    private Integer pageIndex;    private Integer totalItems;    private Integer totalPages;    public List<WasuColumn> getFolders() {        return folders;    }    public void setFolders(List<WasuColumn> folders) {        this.folders = folders;    }    public Integer getPageIndex() {        return pageIndex;    }    public void setPageIndex(Integer pageIndex) {        this.pageIndex = pageIndex;    }    public Integer getTotalItems() {        return totalItems;    }    public void setTotalItems(Integer totalItems) {        this.totalItems = totalItems;    }    public Integer getTotalPages() {        return totalPages;    }    public void setTotalPages(Integer totalPages) {        this.totalPages = totalPages;    }}